DROP TABLE IF EXISTS `facilityindex`;
CREATE TABLE `facilityindex` (
  `Id` int(11) NOT NULL auto_increment,
  `componentId` varchar(255) NOT NULL default '',
  `equipmentname` varchar(255) NOT NULL default '',
  `systemName` varchar(255) NOT NULL,
  `subsystemname` varchar(255) default NULL,
  `lineNo` varchar(255) NOT NULL,
  `stationName` varchar(255) default NULL,
  `state` varchar(255) NOT NULL,
  `woringCount` varchar(255) NOT NULL,
  `updatetime` timestamp NOT NULL default '0000-00-00 00:00:00',
  `healthIndex` varchar(255) NOT NULL,
  PRIMARY KEY  (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

