#
# Structure for table "faultinfo"
#

DROP TABLE IF EXISTS `faultinfo`;
CREATE TABLE `faultinfo` (
  `Id` int(11) NOT NULL auto_increment,
  `componentid` varchar(255) NOT NULL,
  `equipmentname` varchar(255) NOT NULL,
  `equipmentid` varchar(255) NOT NULL,
  `systemname` varchar(255) NOT NULL,
  `equipmentDescription` varchar(255) NOT NULL,
  `faulttype` varchar(255) NOT NULL,
  `fultDescription` varchar(255) NOT NULL,
  `faultCause` varchar(255) NOT NULL,
  `influence` varchar(255) NOT NULL,
  `maintenancePolicy` varchar(800) NOT NULL default '',
  `subcomponent` varchar(255) default NULL,
  PRIMARY KEY  (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Data for table "faultinfo"
#

INSERT INTO `faultinfo` VALUES (1,'1','道岔','08.01','信号系统','转辙机','道岔失表示报警','故障描述','反位表示回路室外开路','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除.','a.检查室外电缆是否断线或接线端子是否松动.\nb.检查安全接点(遮断开关)K是否被打开或因故被振开.\nc.检查速动开关的动作接点接触不良.\nd.检查室外电缆混线故障.','转辙机'),(2,'1','道岔','08.01','信号系统','转辙机','道岔失表示报警','故障描述','反位表示回路线圈支路室内开路','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除.','a.三相交流动作电源故障.包括三相交流电源屏停止供电,三相交流电源断相,组合侧面保安器烧毁.\nb.断相保护器DBQ故障.包括断相保护器DBQ的传感线圈断线,断相保护器DBQ输出直流电压低,无直流电压输出.\nc.保护继电器BHJ故障.包括保护继电器BHJ线圈断线以及31-32接点接触不良.\nd.第一启动继电器1DQJ的1-2自闭线圈断线故障.\ne.电阻R3断线故障.\nf.时间继电器TJ的31-33后接点接触不良.\ng.器材间的联接线断线故障.','转辙机'),(3,'1','道岔','08.01','信号系统','转辙机','道岔失表示报警','故障描述','反位表示回路故障','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除.','在道岔表示继电器因故失磁落下时,可通过在分线盘上测量X1,X2(反位为X1,X3)端子间交,直流电压来判断表示电路的故障性质和故障范围','转辙机'),(4,'2','信号机','08.02','信号系统','信号机','列车信号非正常关闭报警','故障描述','列车信号非正常关闭报警','信号机信号用于确保列车运行的安全，防止追尾和冲突；提高运行效率（在保证安全的前提下，缩短行车间隔）；列车必须按严格地信号机的指示运行，否则会导致挤岔冲出车站，在区间导致两列列车正面冲突等事故。在信号机故障的情况下，列车仍然可以运行，但运行安全需由调度员、值班员、司机来保证（负全责）。','1、查看道岔表示的开关量码位，如果码位为定位或反位状态，则表示出现问题。\r\n2、检查道岔扳动是否到位，如果没有扳动到位，则考虑中间有夹杂物存在或道岔超过既定的扳动次数。\r\n3、检查该信号机附近的轨道区段状态，若为轨道区段异常红光带引起，则通知工务人员检修该轨道区段。\r\n4、更换熔丝，检查是否由于电源屏输出过大导致。','信号机'),(5,'3','隧道风机通风系统','03.36','综合监控系统','隧道风机','故障','故障描述','供电电源失电','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','检查设备供电电源是否失电','隧道风机'),(6,'3','隧道风机通风系统','03.36','综合监控系统','隧道风机','故障','故障描述','设备故障','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查叶片，是否积灰等\r\n2.检查螺栓以及安装基础是否牢固。\r\n3.检查电机轴承是否完好\r\n4.检查风机与系统管道安装是否良好\r\n5.三相电流是否平衡，电压是否过低，电源是否单相断电','隧道风机'),(7,'3','隧道风机通风系统','03.36','综合监控系统','隧道风机','故障','故障描述','过热跳闸','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查风机固定螺栓是否牢固。\r\n2.检查润滑油脂是否变质，干净。\r\n3.检查是否风机的选型是否正确合理\r\n4.电机轴承是否损坏','隧道风机'),(8,'3','隧道风机通风系统','03.36','综合监控系统','隧道风机','故障','故障描述','过载','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.风机风机进出分管是否堵塞\r\n2.电动机的输入电压是否过低，电源是否单相断电\r\n3.系统阻力与设计阻力是否偏离过大','隧道风机'),(9,'3','隧道风机通风系统','03.36','综合监控系统','隧道风机','故障','故障描述','过热报警','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查风机固定螺栓是否牢固。\r\n2.检查润滑油脂是否变质，干净。\r\n3.检查是否风机的选型是否正确合理\r\n4.电机轴承是否损坏\r\n5.三相电流是否平衡，电压是否过低','隧道风机'),(10,'4','给排水系统','03.04','综合监控系统','水泵','故障','故障描述','供电电源失电','水泵故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','检查设备供电电源是否失电','水泵'),(11,'4','给排水系统','03.04','综合监控系统','水泵','故障','故障描述','设备故障','水泵故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查潜水泵轴承因安装和使用寿命等原因\r\n2.检查潜水泵叶轮是否不平衡或断裂\r\n3.检查死都因为潜水泵机械密封因使用寿命和使用频率等原因，造成机械密封磨损，密封失效','水泵'),(12,'4','给排水系统','03.04','综合监控系统','水泵','故障','故障描述','过载','水泵故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查潜水泵是否有被堵塞\r\n2.检查紧固螺栓是否松动\r\n3.检查上级电源，常用和备用电源是否都没电\r\n4.检查潜水泵轴承因安装和使用寿命等原因\r\n5.检查潜水泵叶轮是否不平衡或断裂','水泵'),(13,'4','给排水系统','03.04','综合监控系统','水泵','故障','故障描述','高水位报警报警','水泵故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查潜水泵是否有被堵塞\n2.检查紧固螺栓是否松动\n3.检查上级电源，常用和备用电源是否都没电','水泵'),(17,'1','道岔','08.01','信号系统','转辙机','道岔失表示报警','故障描述','定位表示回路室外开路','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除.','a.检查室外电缆是否断线或接线端子是否松动.b.检查安全接点(遮断开关)K是否被打开或因故被振开.c.检查速动开关的动作接点接触不良.d.检查室外电缆混线故障','转辙机'),(18,'1','道岔','08.01','信号系统','转辙机','道岔失表示报警','故障描述','定位表示回路线圈支路室内开路','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除.','a.三相交流动作电源故障.包括三相交流电源屏停止供电,三相交流电源断相,组合侧面保安器烧毁.b.断相保护器DBQ故障.包括断相保护器DBQ的传感线圈断线,断相保护器DBQ输出直流电压低,无直流电压输出.c.保护继电器BHJ故障.包括保护继电器BHJ线圈断线以及31-32接点接触不良.d.第一启动继电器1DQJ的1-2自闭线圈断线故障.e.电阻R3断线故障.f.时间继电器TJ的31-33后接点接触不良.g.器材间的联接线断线故障.','转辙机'),(19,'1','道岔','08.01','信号系统','转辙机','道岔失表示报警','故障描述','定位表示回路故障','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除.','在道岔表示继电器因故失磁落下时,可通过在分线盘上测量X1,X2(反位为X1,X3)端子间交,直流电压来判断表示电路的故障性质和故障范围','转辙机'),(20,'6','上下行轨道','13.100','10号线线路','轨道','预警','故障描述','轨向不平顺','轨道不平顺是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。','轨向不平顺由铺轨施工和大修作业的轨道中心线定位偏差、轨排横向残余变形积累和轨头侧面磨耗不均匀、扣件失效、轨道横向弹性不一致等造成。建议检查是否这几个方面的原因造成的','轨道'),(21,'6','上下行轨道','13.100','10号线线路','轨道','预警','故障描述','高低不平顺','轨道不平顺是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。','高低不平顺主要由线路施工和大修作业的高程偏差、桥梁挠曲变形、轨道垂向刚度不一致、道床和路基的不均匀残余变形或沉降不均匀、轨道间各部件的间隔不相等、存在暗坑、吊板等造成的，建议检查是否这几个方面的原因造成的','轨道'),(22,'6','上下行轨道','13.100','10号线线路','轨道','预警','故障描述','水平不平顺','轨道不平顺是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。','水平不平顺主要由左右轨道两侧强度不一致或受力不均匀造成的，建议检查是否这几个方面的原因造成的','轨道'),(23,'7','上下行触网','14.101','10号线线路','触网','预警','故障描述','拉出值超限','接触网是牵引供电系统中的重要组成部分，由于其设置的特殊性(机、电合一，露天设置，动态工作，没有备用)，所以一旦发生故障将会直接影响牵引供电系统的正常运行，严重时还会中断地铁列车的行车功能，对地铁的运营造成重大影响。','1.供电调度下达准许作业命令后，在作业区两端验电接地并设好行车防护即开工。\r\n2.将作业车平台调至适当位置，并安排作业人员1-2人实际测量导线高度。\r\n3.将损坏的零部件视情况拆除。\r\n4.定位装置的处理同前述。\r\n5.消除停电作业命令，清理作业现场结束作业。','触网'),(24,'7','上下行触网','14.101','10号线线路','触网','预警','故障描述','导高超限','接触网是牵引供电系统中的重要组成部分，由于其设置的特殊性(机、电合一，露天设置，动态工作，没有备用)，所以一旦发生故障将会直接影响牵引供电系统的正常运行，严重时还会中断地铁列车的行车功能，对地铁的运营造成重大影响。','1.供电调度下达准许作业命令后，在作业区两端验电接地并设好行车防护即开工。\r\n2.将作业车平台调至适当位置，并安排作业人员1-2人实际测量导线高度。\r\n3.调整腕臂底座或拉杆底座的高度，必要时将底座安装在支柱预留孔外，使导线高度达到设计值。\r\n4.调整高度后，结构高度不能有大的变化，相邻跨距的导线应平直，减少机车运行中受电弓的离线次数。\r\n5.按技术要求调整各部件参数。\r\n6.消除停电作业命令，清理作业现场结束作业。','触网'),(25,'7','上下行触网','14.101','10号线线路','触网','预警','故障描述','磨耗异常','接触网是牵引供电系统中的重要组成部分，由于其设置的特殊性(机、电合一，露天设置，动态工作，没有备用)，所以一旦发生故障将会直接影响牵引供电系统的正常运行，严重时还会中断地铁列车的行车功能，对地铁的运营造成重大影响。','1.优化接触线的布置\r\n2.调整接触线的偏移量，使其分布密度符合正态分布规律或基本符合正态分布规律。\r\n','触网'),(26,'7','上下行触网','14.101','10号线线路','触网','预警','故障描述','水平距离异常','接触网是牵引供电系统中的重要组成部分，由于其设置的特殊性(机、电合一，露天设置，动态工作，没有备用)，所以一旦发生故障将会直接影响牵引供电系统的正常运行，严重时还会中断地铁列车的行车功能，对地铁的运营造成重大影响。','1.供电调度下达准许作业命令后，在作业区两端验电接地并设好行车防护即开工。\r\n2.将作业车平台调至适当位置，并安排作业人员1-2人实际测量水平距离。\r\n3.调整水平距离，使水平距离达到设计值。\r\n4.调整水平距离后，结构高度不能有大的变化，相邻跨距的导线应平直，减少机车运行中受电弓的离线次数。\r\n5.按技术要求调整各部件参数。\r\n6.消除停电作业命令，清理作业现场结束作业。','触网'),(27,'7','上下行触网','14.101','10号线线路','触网','预警','故障描述','接触线坡度异常','接触网是牵引供电系统中的重要组成部分，由于其设置的特殊性(机、电合一，露天设置，动态工作，没有备用)，所以一旦发生故障将会直接影响牵引供电系统的正常运行，严重时还会中断地铁列车的行车功能，对地铁的运营造成重大影响。','按规定周期测量接触线的拉出值（之字值）、导线高度和跨中接触线对受电弓的最大偏移值，不合标准应及时安排处理调整。\r\n按规定时间巡视检查定位器的坡度和沿线路方向的偏移角度，不合标准应及时进行调整。温度变化大的季节应加强巡视检查次数，调整及更换不符合标准的吊弦。\r\n定期对接触线高度、坡度、之字值（拉出值），电连接器工作状态和接触情况，接触线局部磨耗及硬点情况，各种线夹安装及工作情况，绝缘子性能，支柱侧面限界等技术参数进行综合检测，发现问题，根据情况及时安排处理。','触网'),(28,'7','上下行触网','14.101','10号线线路','触网','预警','故障描述','定位器坡度异常','接触网是牵引供电系统中的重要组成部分，由于其设置的特殊性(机、电合一，露天设置，动态工作，没有备用)，所以一旦发生故障将会直接影响牵引供电系统的正常运行，严重时还会中断地铁列车的行车功能，对地铁的运营造成重大影响。','设好行车防护即开工。\r\n2.将作业车平台调至适当位置，并安排作业人员1-2人实际测量导线高度。\r\n3.依次安装定位环、定位管、定位管卡子、斜吊线定位环、定位器、定位线夹。\r\n4.按技术要求调整接触线拉出值、定位坡度、定位偏移方向及偏移值。\r\n5.消除停电作业命令，清理作业现场结束作业。\r\n','触网'),(29,'7','上下行触网','14.101','10号线线路','触网','预警','故障描述','槽钢水平度异常','接触网是牵引供电系统中的重要组成部分，由于其设置的特殊性(机、电合一，露天设置，动态工作，没有备用)，所以一旦发生故障将会直接影响牵引供电系统的正常运行，严重时还会中断地铁列车的行车功能，对地铁的运营造成重大影响。','1.供电调度下达准许作业命令后，在作业区两端验电接地并设好行车防护即开工。\r\n2.将作业车平台调至适当位置，并安排作业人员1-2人实际测量导线高度。\r\n3.依次安装定位环、定位管、定位管卡子、斜吊线定位环、定位器、定位线夹。\r\n4.按技术要求调整接触线拉出值、定位坡度、定位偏移方向及偏移值。\r\n5.消除停电作业命令，清理作业现场结束作业。\r\n','触网'),(30,'8','桥梁','16.300','10号线线路','桥梁','预警','故障描述','黄色预警','桥梁变形是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。','派人巡查，并以其他手段复测主梁高程，确认报警原因','桥梁'),(31,'8','桥梁','16.300','10号线线路','桥梁','预警','故障描述','红色预警','桥梁变形是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。','详细检查，必要时进入维修程序\r\n限制行驶，详细检查，必要时制定大修或加固方案','桥梁'),(32,'9','隧道','15.200','10号线线路','隧道','预警','故障描述','一级预警','隧道轮廓变形超限，有可能造成机车车辆撞击隧道，严重影响机车车辆在轨道线路上的运行安全','派人巡查，并以其他手段复测隧道轮廓，确认报警原因','隧道'),(33,'9','隧道','15.200','10号线线路','隧道','预警','故障描述','二级预警','隧道轮廓变形超限，有可能造成机车车辆撞击隧道，严重影响机车车辆在轨道线路上的运行安全','详细检查，必要时进入维修程','隧道'),(34,'9','隧道','15.200','10号线线路','隧道','预警','故障描述','三级预警','隧道轮廓变形超限，有可能造成机车车辆撞击隧道，严重影响机车车辆在轨道线路上的运行安全','限制行驶，详细检查，必要时制定大修','隧道'),(45,'5','高压开关柜','02.24','综合监控系统','断路器','跳闸','故障描述','开关差动保护跳闸','开关柜负责对轨道交通内的设备进行供电，其出现故障后，对于运营会造成一定的影响，为避免造成大的影响，故障出现后应立即维修。','1.行程开关调节不当：行程开关是控制电机储能位置的限位开关。当电机储能到位时，将电机源切断。如果限位过高时，机构储能已满。故障现象是:电机空转不停机、储能指示灯不亮。只有打开控制开关才能使电机停止。限位调节过低时，电机储能未满提前停机。由于储能不到位开关不能合闸。调节限位的方法是手动慢慢储能找到正确位置，并且紧固。','断路器'),(48,'5','高压开关柜','02.24','综合监控系统','断路器','跳闸','故障描述','开关跳闸回路断线','开关柜负责对轨道交通内的设备进行供电，其出现故障后，对于运营会造成一定的影响，为避免造成大的影响，故障出现后应立即维修。','1.控制电源熔丝熔断或空开跳开，TWJ、HWJ继电器同时失磁，控制回路断线信号报出','断路器'),(54,'5','高压开关柜','02.24','综合监控系统','断路器','跳闸','故障描述','开关过电流','开关柜负责对轨道交通内的设备进行供电，其出现故障后，对于运营会造成一定的影响，为避免造成大的影响，故障出现后应立即维修。','1.过流继电器动作使开关跳闸，是因为线路过负荷。速断跳闸时，应当检查母线、变压器、线路。找到短路故障点，将故障排除后方可送电','断路器');

