INSERT INTO `faultinfo_user2` VALUES (0,'3','88','ww','','2','ww','10','33','2014-03-05 16:17:47','','','','5','',NULL,'',NULL,NULL,NULL,NULL),(31,'10.29.03.36.001','隧道风机TVF_I1','综合监控系统','故障告警','3','隧道风机TVF_I1故障','10','航中路站','2014-03-05 16:58:13','供电电源失电','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','检查设备供电电源是否失电','2','周红','隧道风机TVF_I1',NULL,NULL,'1386308212',111111.00,NULL),(32,'10.29.08.01.001','P01A(转辙机)','信号系统','故障告警','1','道岔失去表示报警 故障','10','航中路站','2014-03-05 16:58:15','定位表示回路故障','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除.','在道岔表示继电器因故失磁落下时,可通过在分线盘上测量X1,X2(反位为X1,X3)端子间交,直流电压来判断表示电路的故障性质和故障范围','2','周红','P01A(转辙机)',NULL,NULL,'1386308211',111111.00,NULL),(33,'10.30.14.101.001','第1区间内上行触网','触网系统','故障预警','4','第1区间内上行拉出值超限','10','航中路站','2014-03-05 16:58:19','拉出值超限','接触网是牵引供电系统中的重要组成部分，由于其设置的特殊性(机、电合一，露天设置，动态工作，没有备用)，所以一旦发生故障将会直接影响牵引供电系统的正常运行，严重时还会中断地铁列车的行车功能，对地铁的运营造成重大影响。','1.供电调度下达准许作业命令后，在作业区两端验电接地并设好行车防护即开工。\r\n2.将作业车平台调至适当位置，并安排作业人员1-2人实际测量导线高度。\r\n3.将损坏的零部件视情况拆除。\r\n4.定位装置的处理同前述。\r\n5.消除停电作业命令，清理作业现场结束作业。','2','周红','第1区间内上行触网',NULL,NULL,'1386308234',111111.00,NULL),(34,'10.29.15.200.001','第一区间隧道','隧道系统','故障预警','4','第一区间隧道一级预警','10','航中路站','2014-03-06 10:06:59','一级预警','隧道轮廓变形超限，有可能造成机车车辆撞击隧道，严重影响机车车辆在轨道线路上的运行安全','详细检查，必要时进入维修程','2','周红','第1区间隧道',NULL,NULL,'1386308244',111111.00,NULL),(35,'10.29.16.300.001','第一区间桥梁','桥梁系统','故障预警','4','第一区间桥梁红色预警','10','航中路站','2014-03-06 10:07:05','红色预警','桥梁变形是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。','详细检查，必要时进入维修程序\r\n限制行驶，详细检查，必要时制定大修或加固方案','2','周红','第1区间桥梁',NULL,NULL,'1386308255',111111.00,NULL),(36,'10.29.02.24.001','101进线开关','电力SCADA系统','故障预警','1','101进线开关跳闸','10','航中路站','2014-03-05 16:58:28','开关过电流','开关柜负责对轨道交通内的设备进行供电，其出现故障后，对于运营会造成一定的影响，为避免造成大的影响，故障出现后应立即维修。','1.过流继电器动作使开关跳闸，是因为线路过负荷。速断跳闸时，应当检查母线、变压器、线路。找到短路故障点，将故障排除后方可送电','2','周红','101进线开关',NULL,NULL,'1386308297',111111.00,NULL),(37,'10.29.13.100.001','第1区间内上行轨道','轨道系统','故障告警','3','第1区间内上行左轨轨向不平顺','10','航中路站','2014-03-05 16:58:37','轨向不平顺','轨道不平顺是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。','轨向不平顺由铺轨施工和大修作业的轨道中心线定位偏差、轨排横向残余变形积累和轨头侧面磨耗不均匀、扣件失效、轨道横向弹性不一致等造成。建议检查是否这几个方面的原因造成的','2','周红','第1区间内上行轨道','e||e||e',NULL,'1386308203',111111.00,NULL),(41,'10.29.03.36.001','隧道风机TVF_I1','综合监控系统','故障告警','3','隧道风机TVF_I1故障','10','航中路站','2014-03-05 17:18:14','供电电源失电','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','检查设备供电电源是否失电','3','曹雪','隧道风机TVF_I1','',NULL,'1386308212',111111.00,NULL),(42,'10.29.08.01.001','P01A(转辙机)','信号系统','故障告警','1','道岔失去表示报警 故障','10','航中路站','2014-03-05 16:57:20','定位表示回路故障','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除.','在道岔表示继电器因故失磁落下时,可通过在分线盘上测量X1,X2(反位为X1,X3)端子间交,直流电压来判断表示电路的故障性质和故障范围','3','曹雪','P01A(转辙机)','',NULL,'1386308211',111111.00,NULL),(43,'10.30.14.101.001','第1区间内上行触网','触网系统','故障预警','4','第1区间内上行拉出值超限','10','航中路站','2014-03-05 16:57:23','拉出值超限','接触网是牵引供电系统中的重要组成部分，由于其设置的特殊性(机、电合一，露天设置，动态工作，没有备用)，所以一旦发生故障将会直接影响牵引供电系统的正常运行，严重时还会中断地铁列车的行车功能，对地铁的运营造成重大影响。','1.供电调度下达准许作业命令后，在作业区两端验电接地并设好行车防护即开工。\r\n2.将作业车平台调至适当位置，并安排作业人员1-2人实际测量导线高度。\r\n3.将损坏的零部件视情况拆除。\r\n4.定位装置的处理同前述。\r\n5.消除停电作业命令，清理作业现场结束作业。','3','曹雪','第1区间内上行触网','',NULL,'1386308234',111111.00,NULL),(44,'10.29.15.200.001','第一区间隧道','隧道系统','故障预警','4','第一区间隧道一级预警','10','航中路站','2014-03-06 10:06:26','一级预警','隧道轮廓变形超限，有可能造成机车车辆撞击隧道，严重影响机车车辆在轨道线路上的运行安全','详细检查，必要时进入维修程','3','曹雪','第1区间隧道','',NULL,'1386308244',111111.00,NULL),(45,'10.29.16.300.001','第一区间桥梁','桥梁系统','故障预警','4','第一区间桥梁红色预警','10','航中路站','2014-03-06 10:06:38','红色预警','桥梁变形是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。','详细检查，必要时进入维修程序\r\n限制行驶，详细检查，必要时制定大修或加固方案','3','曹雪','第1区间桥梁','',NULL,'1386308255',111111.00,NULL),(46,'10.29.02.24.001','101进线开关','电力SCADA系统','故障预警','1','101进线开关跳闸','10','航中路站','2014-03-05 16:57:28','开关过电流','开关柜负责对轨道交通内的设备进行供电，其出现故障后，对于运营会造成一定的影响，为避免造成大的影响，故障出现后应立即维修。','1.过流继电器动作使开关跳闸，