CREATE TABLE `influence` (
  `Id` int(11) NOT NULL auto_increment,
  `componentid` varchar(255) NOT NULL,
  `influenceInfo` varchar(255) NOT NULL,
  PRIMARY KEY  (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Data for table "influence"
#

INSERT INTO `influence` VALUES (1,'1','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除。'),(2,'2','信号机信号用于确保列车运行的安全，防止追尾和冲突；提高运行效率（在保证安全的前提下，缩短行车间隔）；列车必须按严格地信号机的指示运行，否则会导致挤岔冲出车站，在区间导致两列列车正面冲突等事故。在信号机故障的情况下，列车仍然可以运行，但运行安全需由调度员、值班员、司机来保证（负全责）。'),(3,'3','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。'),(4,'4','水泵故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。'),(5,'5','开关柜负责对轨道交通内的设备进行供电，其出现故障后，对于运营会造成一定的影响，为避免造成大的影响，故障出现后应立即维修。'),(6,'6','开关柜负责对轨道交通内的设备进行供电，其出现故障后，对于运营会造成一定的影响，为避免造成大的影响，故障出现后应立即维修。');

