INSERT INTO `inform_plan` VALUES (1,'1385359857','10.29.08.01.001','P01A(转辙机)','轨旁设备','信号系统','10','航中路站','计划预警','大修','转辙机清理工作','2013-10-22 13:28:22','0','2'),(2,'1385359854','10.29.02.24.001','101进线开关','电力SCADA系统','综合监控系统','10','航中路站','计划预警','大修','检查开关柜状况','2013-10-22 13:28:22','0','2'),(3,'1385359855','10.29.02.110.001','第1区间内上行轨道','轨道系统','10号线线路','10','航中路站','计划预警','小修','检查轨道','2013-10-22 13:28:22','0','2'),(4,'1385359856','10.29.02.100.001','第1区间内上行触网','触网系统','10号线线路','10','航中路站','计划预警','中修','检查触网','2013-10-22 13:28:22','0','2'),(5,'1385977288','10.29.08.01.001','P01A道岔转辙机','轨旁设备','信号系统','10','航中路站','计划预警','中修','1．成组更换新道岔（对道岔所有部件进行更换）\r\n2．成组更换新岔枕','2014-02-02 00:00:00','0','2'),(6,'1385977476','10.29.08.01.001','P01A道岔转辙机','轨旁设备','信号系统','10','航中路站','计划预警','中修','1．成组更换新道岔（对道岔所有部件进行更换）\r\n2．成组更换新岔枕','2014-02-02 00:00:00','0','2'),(7,'1385977488','10.29.08.01.001','P01A道岔转辙机','轨旁设备','信号系统','10','航中路站','计划预警','中修','1．成组更换新道岔（对道岔所有部件进行更换）\r\n2．成组更换新岔枕','2014-02-02 00:00:00','0','2'),(8,'1385977497','10.29.08.01.001','P01A道岔转辙机','轨旁设备','信号系统','10','航中路站','计划预警','中修','1．成组更换新道岔（对道岔所有部件进行更换）\r\n2．成组更换新岔枕','2014-02-02 00:00:00','0','2'),(9,'1385977529','10.29.08.01.001','P01A道岔转辙机','轨旁设备','信号系统','10','航中路站','计划预警','中修','1．成组更换新道岔（对道岔所有部件进行更换）\r\n2．成组更换新岔枕','2014-02-02 00:00:00','0','2'),(10,'1386032655','10.29.02.24.001','35kv高压开关','电力SCADA系统','综合监控系统','10','航中路站','计划预警','大修','1.调换和修补裂缝严重的砼杆。  \r\n2.塔基础加固，如增加埋深，杆根培土等。\r\n3.换、调整杆塔的拉线及拉棒等，保证拉线应有的设计强度。包括拉线棒以下的隐蔽部分。  \r\n4.调换腐烂铁横担，扶正倾斜悬瓶、瓷担。调整耐张横担，并除锈、防腐处理，对横担各部螺重新紧固。  \r\n5.调杆、降杆或移杆，扶正倾斜杆塔。\r\n6.锈蚀铁塔的除锈防腐处理。\r\n7.改善防雷设施，重新埋设接地体，或调换严重锈蚀的接地引下线或联接线夹。','2017-02-02 00:00:00','0','5'),(11,'1386032661','10.29.08.01.001','P01A道岔转辙机','轨旁设备','信号系统','10','航中路站','计划预警','中修','1．成组更换新道岔（对道岔所有部件进行更换）\r\n2．成组更换新岔枕','2014-02-02 00:00:00','0','2'),(12,'1386032675','10.29.03.04.008 ','水泵','BAS系统','综合监控系统','10','航中路站','计划预警','大修','1.包括中修内容。\r\n2.更换叶轮及导叶。\r\n3. 更换泵轴。\r\n4.泵体各段检测、鉴定和作必要的修理。\r\n5.调整泵体的水平度。\r\n6.设备及附属管线除锈防腐。','2017-02-02 00:00:00','0','5'),(13,'1386032779','10.29.13.100.001','第1区间内上行轨道','轨道系统','10号线线路','10','航中路站','计划预警','中修','连续更换25米以上200米以下（含200米）伤损钢轨','2014-02-02 00:00:00','0','2');

