INSERT INTO `inform_user4` VALUES (29,'00000000029','周林','2014-03-05 00:00:00','10','航中路站','信号系统','轨旁设备','第1区间内上行轨道','10.29.13.100.001','1','1','第1区间内上行左轨轨向不平顺','轨向不平顺','轨道不平顺是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。','轨向不平顺由铺轨施工和大修作业的轨道中心线定位偏差、轨排横向残余变形积累和轨头侧面磨耗不均匀、扣件失效、轨道横向弹性不一致等造成。建议检查是否这几个方面的原因造成的','第1区间内上行轨道','故障告警','0',10.00),(38,'ODD7369616','黄','2013-12-25 09:50:52','10','龙柏新村','信号系统','轨旁设备','隧道风机通风系统','10.31.03.36.001','1','1','隧道风机TVF_I1故障','设备故障','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查叶片，是否积灰等\n2.检查螺栓以及安装基础是否牢固。\n3.检查电机轴承是否完好\n4.检查风机与系统管道安装是否良好\n5.三相电流是否平衡，电压是否过低，电源是否单相断电','隧道风机TVF_I1','故障告警','0',3423.00),(48,'ODD7369633','小王','2014-03-04 10:12:55','10','龙柏新村','信号系统','轨旁设备','给排水系统','10.31.03.04.008','1','1','区间水泵故障','供电电源失电','水泵故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','检查设备供电电源是否失电','区间水泵','故障告警','0',11242.00),(55,'ODD7369543','黄','2013-12-25 09:50:55','10','航中路站','综合监控系统','BAS系统','隧道风机通风系统','10.29.03.36.001','1','1','隧道风机TVF_I1故障','过载','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.风机风机进出分管是否堵塞\n2.电动机的输入电压是否过低，电源是否单相断电\n3.系统阻力与设计阻力是否偏离过大','隧道风机TVF_I1','故障告警','0',2332.00),(58,'ODD7369678','黄','2013-12-25 09:50:58','10','航中路站','信号系统','BAS系统','给排水系统','10.29.03.04.008','1','1','区间水泵故障','设备故障','水泵故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查潜水泵轴承因安装和使用寿命等原因\n2.检查潜水泵叶轮是否不平衡或断裂\n3.检查死都因为潜水泵机械密封因使用寿命和使用频率等原因，造成机械密封磨损，密封失效','区间水泵','故障告警','0',23455.00),(67,'ODD7369897','黄','2013-12-25 09:51:01','10','紫藤路','综合监控系统','BAS系统','隧道风机通风系统','10.30.03.36.001','1','1','隧道风机TVF_I1故障','过热跳闸','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查风机固定螺栓是否牢固。\n2.检查润滑油脂是否变质，干净。\n3.检查是否风机的选型是否正确合理\n4.电机轴承是否损坏','隧道风机TVF_I1','故障告警','0',23421.00),(68,'ODD7369332','小王','2013-12-25 09:51:04','10','紫藤路','信号系统','轨旁设备','信号机','10.30.08.02.001','2','2','列车信号非正常关闭报警','列车信号非正常关闭报警','信号机信号用于确保列车运行的安全，防止追尾和冲突；提高运行效率（在保证安全的前提下，缩短行车间隔）；列车必须按严格地信号机的指示运行，否则会导致挤岔冲出车站，在区间导致两列列车正面冲突等事故。在信号机故障的情况下，列车仍然可以运行，但运行安全需由调度员、值班员、司机来保证（负全责）。','1、查看道岔表示的开关量码位，如果码位为定位或反位状态，则表示出现问题。\n2、检查道岔扳动是否到位，如果没有扳动到位，则考虑中间有夹杂物存在或道岔超过既定的扳动次数。\n3、检查该信号机附近的轨道区段状态，若为轨道区段异常红光带引起，则通知工务人员检修该轨道区段。\n4、更换熔丝，检查是否由于电源屏输出过大导致。','S03A信号机','故障告警','0',4442.00),(78,'ODD7369232','黄','2013-12-25 09:51:06','10','紫藤路','综合监控系统','BAS系统','隧道风机通风系统','10.30.03.36.001','1','1','隧道风机TVF_I1故障','过热报警','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查风机固定螺栓是否牢固。\n2.检查润滑油脂是否变质，干净。\n3.检查是否风机的选型是否正确合理\n4.电机轴承是否损坏\n5.三相电流是否平衡，电压是否过低','隧道风机TVF_I1','故障告警','0',5564.00),(128,'ODD7369343','黄','2013-12-25 09:51:09','10','龙柏新村','信号系统','轨旁设备','道岔','10.31.08.01.001','1','1','道岔无表示报警','定位表示回路故障','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除。','1.检查室外二极管是否异常，如异常更换二极管\n2.定位时检查室外回路电缆是否断开\n3.反位时检查室外回路电缆是否断开','P12B(转辙机)','故障告警','0',23255.00),(133,'ODD7369123','黄','2013-12-25 09:51:11','10','龙柏新村','信号系统','轨旁设备','信号机','10.31.08.02.001','1','1','列车信号非正常关闭报警','列车信号非正常关闭报警','信号机信号用于确保列车运行的安全，防止追尾和冲突；提高运行效率（在保证安全的前提下，缩短行车间隔）；列车必须按严格地信号机的指示运行，否则会导致挤岔冲出车站，在区间导致两列列车正面冲突等事故。在信号机故障的情况下，列车仍然可以运行，但运行安全需由调度员、值班员、司机来保证（负全责）。','1、查看道岔表示的开关量码位，如果码位为定位或反位状态，则表示出现问题。\n2、检查道岔扳动是否到位，如果没有扳动到位，则考虑中间有夹杂物存在或道岔超过既定的扳动次数。\n3、检查该信号机附近的轨道区段状态，若为轨道区段异常红光带引起，则通知工务人员检修该轨道区段。\n4、更换熔丝，检查是否由于电源屏输出过大导致。','S16B信号机','故障告警','0',5554.00),(148,'ODD7369453','黄','2013-12-25 09:51:14','10','龙柏新村','综合监控系统','BAS系统','隧道风机通风系统','10.31.03.36.001         ','3','1','隧道风机TVF_I1故障','设备故障','风机故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查叶片，是否积灰等\n2.检查螺栓以及安装基础是否牢固。\n3.检查电机轴承是否完好\n4.检查风机与系统管道安装是否良好\n5.三相电流是否平衡，电压是否过低，电源是否单相断电','隧道风机TVF_I1','故障告警','0',4342.00),(158,'ODD7369368','黄','2013-12-25 09:51:17','10','龙柏新村','信号系统','BAS系统','高压开关柜','10.31.02.25.005','1','1','111动力变开关跳闸','开关差动保护跳闸  ','开关柜负责对轨道交通内的设备进行供电，其出现故障后，对于运营会造成一定的影响，为避免造成大的影响，故障出现后应立即维修。','1.行程开关调节不当：行程开关是控制电机储能位置的限位开关。当电机储能到位时，将电机源切断。如果限位过高时，机构储能已满。故障现象是:电机空转不停机、储能指示灯不亮。只有打开控制开关才能使电机停止。限位调节过低时，电机储能未满提前停机。由于储能不到位开关不能合闸。调节限位的方法是手动慢慢储能找到正确位置，并且紧固。\n2、电机故障：绕组烧毁（异味、冒烟、保险熔断）；电机两端有电压，电机不转（碳刷脱落、磨损）。判断是否电机故障方法：测电机端电压、电阻、或其他好电机替换）\n3、控制开关故障或电路开路：控制开关损坏→电路无法闭合；控制回路断线→电机不转、两端无压。查找方法：万用表测电压、电阻','111动力变开关','故障告警','0',2356.00),(163,'ODD7369613','黄','2013-12-10 09:19:20','10','龙柏新村','信号系统','轨旁设备','给排水系统','10.31.03.04.008','1','1','区间水泵故障','设备故障','水泵故障对于轨道交通运营造成的影响相对较小，不影响列车的正常运行，为避免造成大的影响，故障出现后应立即维修。','1.检查潜水泵轴承因安装和使用寿命等原因\n2.检查潜水泵叶轮是否不平衡或断裂\n3.检查死都因为潜水泵机械密封因使用寿命和使用频率等原因，造成机械密封磨损，密封失效','区间水泵','故障预警','0',22223.00),(554,'ODD7369332','黄','2013-12-25 09:51:21','10','龙柏新村','信号系统','轨旁设备','道岔','10.31.08.01.001','1','1','道岔无表示报警','定位表示回路故障','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除。','1.检查室外二极管是否异常，如异常更换二极管\n2.定位时检查室外回路电缆是否断开\n3.反位时检查室外回路电缆是否断开','P12B(转辙机)','计划预警','0',5567.00);

