'12345678765','定位表示回路故障','同意||同意||同意','2013-09-22 00:00:00','2','故障影响。。。。。。'),(106,'10.30.03.04.008','给排水系统','综合监控系统','区间水泵','10','紫藤路','2013-09-03 00:00:00','更换部件','维修内容','良好','张师傅','李师傅','完成维修','故障告警','告警信息','维修策略','22233332222','故障可能原因','同意||同意||同意','2013-09-22 00:00:00','3','故障影响。。。。。。'),(126,'10.29.08.01.001','道岔','信号系统','P01A(转辙机)','10','航中路站','2014-01-22 01:01:12','二极管','更换室外二极管','良好','张师傅','李师傅','完成维修','故障告警','道岔失表示','1.检查室外二极管是否异常，如异常更换二极管\r\n2.定位时检查室外回路电缆是否断开\r\n3.反位时检查室外回路电缆是否断开','12345678765','定位表示回路故障','同意||同意||同意','2013-09-22 00:00:00','1','道岔是一种使机车车辆从一股道道转入另一股道的线路连接设备，通常在车站站、编组站站大量铺设。道岔出现故障后，若列车继续在故障区段运行，将造成严重的后果，故对于故障道岔的影响区段，需停止轨道交通车辆的运行，直至故障排除。'),(129,'10.31.08.01.001','道岔','信号系统','P12B(转辙机)','10','龙柏新村','2013-09-12 00:00:00','更换部件','维修内容','良好','张师傅','李师傅','完成维修','故障告警','告警信息','维修策略','22233332222','故障可能原因','同意||同意||同意','2013-09-22 00:00:00','4','故障影响。。。。。。'),(138,'10.31.08.02.001','信号机','信号系统','S16B信号机','10','龙柏新村','2013-09-22 00:00:00','更换部件','维修内容','良好','张师傅','李师傅','完成维修','故障告警','告警信息','维修策略','22233332222','故障可能原因','同意||同意||同意','2013-09-22 00:00:00','4','故障影响。。。。。。'),(146,'10.31.03.36.001         ','隧道风机通风系统','综合监控系统','隧道风机TVF_I1','10','龙柏新村','2013-09-06 00:00:00','更换部件','维修内容','良好','张师傅','李师傅','完成维修','故障预警','告警信息','维修策略','22233332222','故障可能原因','同意||同意||同意','2013-09-22 00:00:00','3','故障影响。。。。。。'),(156,'10.31.02.25.005','高压开关柜','综合监控系统','111动力变开关','10','龙柏新村','2013-09-03 00:00:00','更换部件','维修内容','良好','张师傅','李师傅','完成维修','计划预警','告警信息','维修策略','22233332222','故障可能原因','同意||同意||同意','2013-09-22 00:00:00','3','故障影响。。。。。。'),(169,'10.31.03.04.008','给排水系统','信号系统','区间水泵','10','龙柏新村','2013-09-22 00:00:00','更换部件','维修内容','良好','张师傅','李师傅','完成维修','计划预警','告警信息','维修策略','22233332222','故障可能原因','同意||同意||同意','2013-09-22 00:00:00','2','故障影响。。。。。。'),(206,'10.29.08.01.001','道岔','信号系统','P12B(转辙机)','10','航中路站','2013-09-03 00:00:00','更换部件','维修内容','良好','张师傅','李师傅','完成维修','故障预警','告警信息','维修策略','22233332222','故障可能原因','同意||同意||同意','2013-09-22 00:00:00','2','故障影响。。。。。。'),(208,'10.29.16.300.001','第1区间桥梁','桥梁系统','第1区间桥梁','10','航中路站','2014-01-23 01:01:12','更换部件','维修内容','良好','张师傅','李师傅','完成维修','故障预警','第1区间桥梁红色预警','详细检查，必要时进入维修程序\r\n限制行驶，详细检查，必要时制定大修或加固方案','22233332222','红色预警','同意||同意||同意','2013-02-22 23:33:22','2','桥梁变形是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。'),(209,'10.29.02.24.001','高压开关柜','电力SCADA系统','101进线开关','10','航中路站','2014-01-24 01:01:12','更换部件','维修内容','良好','张师傅','李师傅','完成维修','故障告警','跳闸','1.过流继电器动作使开关跳闸，是因为线路过负荷。速断跳闸时，应当检查母线、变压器、线路。找到短路故障点，将故障排除后方可送电','22233332222','开关过电流','同意||同意||同意','2013-03-22 23:33:22','3','开关柜负责对轨道交通内的设备进行供电，其出现故障后，对于运营会造成一定的影响，为避免造成大的影响，故障出现后应立即维修。'),(210,'10.30.14.101.001','上下行触网','触网系统','第1区间内上行触网','10','航中路站','2014-01-25 01:01:12','更换部件','维修内容','良好','张师傅','李师傅','完成维修','故障预警','槽钢水平度异常','1.供电调度下达准许作业命令后，在作业区两端验电接地并设好行车防护即开工。\r\n2.将作业车平台调至适当位置，并安排作业人员1-2人实际测量导线高度。\r\n3.依次安装定位环、定位管、定位管卡子、斜吊线定位环、定位器、定位线夹。\r\n4.按技术要求调整接触线拉出值、定位坡度、定位偏移方向及偏移值。\r\n5.消除停电作业命令，清理作业现场结束作业。','22233332222','槽钢水平度异常','同意||同意||同意','2013-04-22 23:33:22','1','接触网是牵引供电系统中的重要组成部分，由于其设置的特殊性(机、电合一，露天设置，动态工作，没有备用)，所以一旦发生故障将会直接影响牵引供电系统的正常运行，严重时还会中断地铁列车的行车功能，对地铁的运营造成重大影响。'),(211,'10.29.13.100.001','上下行轨道','轨道系统','第1区间内上行轨道','10','航中路站','2014-01-26 01:01:12','更换部件','维修内容','良好','张师傅','李师傅','完成维修','故障预警','第1区间内上行左轨轨向不平顺','详细检查，必要时进入维修程序\r\n限制行驶，详细检查，必要时制定大修或加固方案','22233332222','第1区间内上行左轨轨向不平顺','同意||同意||同意','2013-05-22 23:33:22','3','轨道不平顺是引起机车车辆产生振动、轮轨噪声、动作用力的主要原因。对行车平稳舒适和行车安全都有重要影响，在高速行车条件下，影响更大，甚至有可能造成脱轨。');

#
# Structure for table "maintain_plan_table"
#

DROP TABLE IF EXISTS `maintain_plan_table`;
CREATE TABLE `maintain_plan_table` (
  `Id` int(11) NOT NULL auto_increment,
  `equipmentId` varchar(255) default NULL,
  `equipmentname` varchar(255) default NULL,
  `subsystemName` varchar(255) default NULL,
  `systemName` varchar(255) default NULL,
  `lineNo` varchar(255) default NULL,
  `stationName` varchar(255) default NULL,
  `warningType` varchar(255) default NULL,
  `warningTypeLevel` varchar(255) default NULL,
  `maintaininfo` varchar(800) default NULL,
  `lastTime_maintainDate` timestamp NULL default NULL,
  `productDate` timestamp NULL default NULL,
  `next_maintainDate` timestamp NULL default NULL,
  `maintain_period` varchar(10) default NULL,
  PRIMARY KEY  (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Data for table "maintain_plan_table"
#

INSERT INTO `maintain_plan_table` VALUES (1,'10.29.08.01.001','P01A(转辙机)','轨旁设备','信号系统','10','航中路站','计划预警','小修','对道岔进行全面性检查、涂油保养\r\n2．道岔磨耗检查\r\n每年\r\n3．对道岔磨耗超限的进行焊补或更换\r\n4．更换伤损超标的岔心、尖轨、长短心轨\r\n5．对滑床板已损、变形、磨耗超限的进行打磨或更换\r\n6．各种零配件已变形失效的进行更换\r\n7．更换达到下线标准的整组道岔\r\n8．按设计安装防爬设备和缓冲垫板','2012-02-02 00:00:00','2010-02-01 00:00:00','2013-02-02 00:00:00','1'),(3,'10.29.13.100.001','第1区间内上行轨道','轨道系统','10号线线路','10','航中路站','计划预警','小修','1．开行钢轨打磨车对正线钢轨作预防性打磨（根据磨损情况定或定期）\r\n2．测量钢轨的磨耗并做好记录\r\n3．更换50m及以下需要更换的钢轨\r\n4．对轨面擦伤和剥落掉块的进行处理\r\n5．对钢轨飞边及铝热焊接头凸出的进行打磨\r\n6.对低接头进行处理,保持其平顺,处理钢轨的串动、爬行情况\r\n7． 运营五年以上焊接接头专项探伤\r\n8． 对易锈蚀地段钢轨涂上防锈剂\r\n9．全面调整轨缝\r\n10．焊接接头','2011-11-25 13:28:22','2009-10-22 13:28:22','2013-11-25 13:28:22','2'),(5,'10.29.08.01.001','P01A道岔转辙机','轨旁设备','信号系统','10','航中路站','计划预警','大修','1．重新放线铺设道岔','2012-02-02 00:00:00','2010-02-01 00:00:00','2022-02-02 00:00:00','10'),(6,'10.29.08.01.001','P01A道岔转辙机','轨旁设备','信号系统','10','航中路站','计划预警','中修','1．成组更换新道岔（对道岔所有部件进行更换）\r\n2．成组更换新岔枕','2012-02-02 00:00:00','2010-02-01 00:00:00','2014-02-02 00:00:00','2'),(7,'10.29.03.36.001 ','隧道风机','BAS系统','综合监控系统','10','航中路站','计划预警','小修','1.检查轴承、齿轮传动、齿轮箱油位，添加或更换润滑油。\r\n2.检查、紧固螺拴。\r\n3.消除跑、冒、滴、漏。','2012-02-02 00:00:00','2010-02-01 00:00:00','2013-02-02 00:00:00','1'),(8,'10.29.13.100.001','第1区间内上行轨道','轨道系统','10号线线路','10','航中路站','计划预警','中修','连续更换25米以上200米以下（含200米）伤损钢轨','2012-02-02 00:00:00','2010-02-01 00:00:00','2014-02-02 00:00:00','2'),(9,'10.29.03.36.001 ','隧道风机','BAS系统','综合监控系统','10','航中路站','计划预警','中修','包括小修内容。\r\n清洗、检查轴承及轴承箱，更换轴承。\r\n清洗密封装置，更换填料或密封环。\r\n清洗、检查传动齿轮及各零、部件。 \r\n测量、调整各部间隙。\r\n检查、更换联轴器及附件。','2012-02-02 00:00:00','2010-02-01 00:00:00','2014-02-02 00:00:00','2'),(10,'10.29.03.36.001','隧道风机','BAS系统','综合监控系统','10','航中路站','计划预警','大修','包括中修内容。 \r\n检查或更换主轴、传动轴及前后墙板。 \r\n检查或更换主动、从动转子。 \r\n做转子的静平衡、动平衡。','2012-02-02 00:00:00','2010-02-01 00:00:00','2014-02-02 00:00:00','2'),(11,'10.29.03.04.008 ','水泵','BAS系统','综合监控系统','10','航中路站','计划预警','小修','检修填料密封，更换填料。\r\n检查轴承及润滑系统，更换润滑油(脂)。\r\n清理、检修冷却水系统。\r\n清扫、检修阀门。\r\n检查及找正联轴器，调整轴向间隙，更换联轴器易损件。\r\n消除在运行中发现的缺陷和渗漏，及检查和紧固各部螺栓。','2012-02-02 00:00:00','2010-02-01 00:00:00','2013-02-02 00:00:00','1'),(12,'10.29.03.04.008 ','水泵','BAS系统','综合监控系统','10','航中路站','计划预警','中修','1.包括小修内容。\r\n2.检修机械密封，更换零件。\r\n3.解体、清洗检查叶轮、密封环、衬套、轴套、导叶、平衡盘、平衡环及各部零件的磨损、腐蚀、冲蚀程度，予以修复或更换。\r\n4.修理及刮研轴瓦、调整间隙，以及更换轴承。\r\n5.测定叶轮的静平衡。\r\n6.检查各段叶轮毅、轴套、平衡盘毂、紧固螺母间端面接触情况，测量及校正各段叶轮间距。\r\n7.测量泵轴及转子部件各部跳动量。\r\n8.检查、调整各部间隙。调整转子窜动量。\r\n9.校验压力表。\r\n10.检修电机。','2012-02-02 00:00:00','2010-02-01 00:00:00','2014-02-02 00:00:00','2'),(13,'10.29.03.04.008 ','水泵','BAS系统','综合监控系统','10','航中路站','计划预警','大修','1.包括中修内容。\r\n2.更换叶轮及导叶。\r\n3. 更换泵轴。\r\n4.泵体各段检测、鉴定和作必要的修理。\r\n5.调整泵体的水平度。\r\n6.设备及附属管线除锈防腐。','2012-02-02 00:00:00','2010-02-01 00:00:00','2017-02-02 00:00:00','5'),(14,'10.29.02.24.001','35kv高压开关','电力SCADA系统','综合监控系统','10','航中路站','计划预警','小修','1.全线登杆清扫，对悬瓶、瓷担做好敲击试验，并检查耐张线夹等金具的完好程度。 \r\n2.扶正倾斜瓷担、悬瓶或硅橡胶合成绝缘子，检查杆塔前后各2米范围内的导线、地线完好情况，检查扎线、铝包带的完好情况，瓷担线路还应修补防鸟网。  \r\n4.紧固各部件的螺栓螺母，调换破碎瓷瓶、瓷担或硅橡胶合成绝缘子。 \r\n5.整直歪斜杆塔，对杆根进行培土，加固杆塔基础。   \r\n6.核对杆塔编号、相色。不符者应重编。重写不清的编号、相色。调换、补齐警告牌、标志牌。  7.清除鸟窝、修剪树枝，督促迁移线路走廊两侧不符规定的草棚、柴堆等易燃杂物。','2012-02-02 00:00:00','2010-02-01 00:00:00','2013-02-02 00:00:00','1'),(15,'10.29.02.24.001','35kv高压开关','电力SCADA系统','综合监控系统','10','航中路站','计划预警','大修','1.调换和修补裂缝严重的砼杆。  \r\n2.塔基础加固，如增加埋深，杆根培土等。\r\n3.换、调整杆塔的拉线及拉棒等，保证拉线应有的设计强度。包括拉线棒以下的隐蔽部分。  \r\n4.调换腐烂铁横担，扶正倾斜悬瓶、瓷担。调整耐张横担，并除锈、防腐处理，对横担各部螺重新紧固。  \r\n5.调杆、降杆或移杆，扶正倾斜杆塔。\r\n6.锈蚀铁塔的除锈防腐处理。\r\n7.改善防雷设施，重新埋设接地体，或调换严重锈蚀的接地引下线或联接线夹。','2012-02-02 00:00:00','2010-02-01 00:00:00','2017-02-02 00:00:00','5'),(16,'10.29.16.300.001','桥梁','桥梁系统','10号线线路','10','航中路站','计划预警','中修','利用检测车每年对高架桥桥墩、支座和梁体\r\n进行一次全面的检查\r\n每年检测2次桥梁结构的沉降 ，检测1次桥\r\n梁线形。','2012-02-02 00:00:00','2010-02-01 00:00:00','2013-02-02 00:00:00','1'),(17,'10.29.16.300.001','桥梁','桥梁系统','10号线线路','10','航中路站','计划预警','大修','每7年对桥梁进行一次结构应力、动力特\r\n性、钢箱梁高强联结螺栓的检查','2012-02-02 00:00:00','2010-02-01 00:00:00','2019-02-02 00:00:00','7'),(18,'10.29.16.200.001','隧道','隧道系统','10号线线路','10','航中路站','计划预警','小修','每年的年初对区间隧道进行1次春季大检查，主要检查洞体结构、排水设施、行车避让洞、联络通道、渗漏等；每年的8-9月再对隧道进行一次全面检查，不仅包含以上项目，还包括洞体结构的沉降观测。     2、盾构结构的隧道还要检查管片、管片联结螺栓、管片间的密封条等。     3、区间隧道观测点的布设：隧道内70m~80m/处，每个断面设3个点，分别位于洞顶及两侧洞壁。','2012-02-02 00:00:00','2010-02-01 00:00:00','2013-02-02 00:00:00','1'),(19,'10.29.16.200.001','隧道','桥梁系统','10号线线路','10','航中路站','计划预警','大修','每5年对区间隧道进行1次限界检查。','2012-02-02 00:00:00','2010-02-01 00:00:00','2017-02-02 00:00:00','5');

