INSERT INTO `strategy` VALUES (1,'1','道岔无表示报警','1、定（反）位表示回路室外X2(X3)开路','1、检查室外二极管是否异常，如异常更换二极管\r\n2、定位时检查室外X2回路电缆是否断开\r\n3、反位时检查室外X3回路电缆是否断开'),(2,'2','列车信号非正常关闭报警','1、进路中道岔失去表示\r\n2、进路中道岔转不到位\r\n3、进路中轨道区段异常红光带\r\n4、熔丝断丝','1、查看道岔表示的开关量码位，如果码位为定位或反位状态，则表示出现问题。\r\n2、检查道岔扳动是否到位，如果没有扳动到位，则考虑中间有夹杂物存在或道岔超过既定的扳动次数。\r\n3、检查该信号机附近的轨道区段状态，若为轨道区段异常红光带引起，则通知工务人员检修该轨道区段。\r\n4、更换熔丝，检查是否由于电源屏输出过大导致。'),(3,'3','风机故障','1.叶片积灰，污垢过量或检修后叶片错位安装使叶轮产生不平衡。\r\n2.叶片连接螺栓松动使叶片与机壳相碰擦\r\n3.风机安装基础受损\r\n4.电机安装螺栓松动\r\n5.风机与系统管道安装不良，产生共振\r\n6.电机轴承损坏\r\n7.电动机输入电压过低或电源单相断电','1.检查叶片，是否积灰等\r\n2.检查螺栓以及安装基础是否牢固。\r\n3.检查电机轴承是否完好\r\n4.检查风机与系统管道安装是否良好\r\n5.三相电流是否平衡，电压是否过低，电源是否单相断电'),(4,'4','报警','1.潜水泵叶轮吸口处被大杂物缠绕，造成排水流量很少，潜水泵甚至无法排水\r\n2.高水位报警泵房相对应的泄压井内有大量杂物完全堵塞，或者通向市政排水管网的排水管道堵塞。\r\n3.潜水泵叶轮紧固螺栓松动造成叶轮脱落水泵空转\r\n4.水泵控制箱的上级电源无电，常用和备用电源都没有电。','1.检查潜水泵是否有被堵塞\r\n2.检查紧固螺栓是否松动\r\n3.检查上级电源，常用和备用电源是否都没电\r\n4.检查潜水泵轴承因安装和使用寿命等原因\r\n5.检查潜水泵叶轮是否不平衡或断裂'),(5,'5','事故总信号','1.控制电源不正常，控制或者合闸保险熔断。\r\n2. 合闸转换开关接点不通。\r\n3.“远方、就地”转换开关投入错误。\r\n4. 断路器辅助触点不通。\r\n5. 断路器未储能。\r\n6. 工艺连锁点未复位。\r\n7. 机械机构故障。\r\n8. 综保合闸回路内部故障。\r\n9. 合闸线圈烧坏','1.如果线圈烧坏，更换线圈。\r\n2.调整电压至正常范围。\r\n3.如果辅助触点或转换开关坏，更换。\r\n4.换控制保险 \r\n5.调整机械机构，使之灵活好用\r\n6.检查综保回路'),(6,'6','事故总信号','1.控制电源不正常，控制或者合闸保险熔断。\r\n2. 合闸转换开关接点不通。\r\n3.“远方、就地”转换开关投入错误。\r\n4. 断路器辅助触点不通。\r\n5. 断路器未储能。\r\n6. 工艺连锁点未复位。\r\n7. 机械机构故障。\r\n8. 综保合闸回路内部故障。\r\n9. 合闸线圈烧坏','1.如果线圈烧坏，更换线圈。\r\n2.调整电压至正常范围。\r\n3.如果辅助触点或转换开关坏，更换。\r\n4.换控制保险 \r\n5.调整机械机构，使之灵活好用\r\n6.检查综保回路');

