INSERT INTO `warning_plan` VALUES (1,'10.29.02.24.001','101进线开关','电力SCADA系统','综合监控系统','10','航中路站','计划预警','大修','检查开关柜状况维修时间已到','2013-11-25 13:28:22','1'),(2,'10.29.08.01.001','P01A(转辙机)','轨旁设备','信号系统','10','航中路站','计划预警','大修','转辙机清理工作维修时间已到','2013-11-25 13:28:22','1'),(3,'10.29.08.01.001','P01A(转辙机)','轨旁设备','信号系统','10','航中路站','计划预警','小修','对道岔进行全面性检查、涂油保养\r\n2．道岔磨耗检查\r\n每年\r\n3．对道岔磨耗超限的进行焊补或更换\r\n4．更换伤损超标的岔心、尖轨、长短心轨\r\n5．对滑床板已损、变形、磨耗超限的进行打磨或更换\r\n6．各种零配件已变形失效的进行更换\r\n7．更换达到下线标准的整组道岔\r\n8．按设计安装防爬设备和缓冲垫板维修时间已到','2013-02-02 00:00:00','1'),(4,'10.29.13.100.001','第1区间内上行轨道','轨道系统','10号线线路','10','航中路站','计划预警','小修','1．开行钢轨打磨车对正线钢轨作预防性打磨（根据磨损情况定或定期）\r\n2．测量钢轨的磨耗并做好记录\r\n3．更换50m及以下需要更换的钢轨\r\n4．对轨面擦伤和剥落掉块的进行处理\r\n5．对钢轨飞边及铝热焊接头凸出的进行打磨\r\n6.对低接头进行处理,保持其平顺,处理钢轨的串动、爬行情况\r\n7． 运营五年以上焊接接头专项探伤\r\n8． 对易锈蚀地段钢轨涂上防锈剂\r\n9．全面调整轨缝\r\n10．焊接接头维修时间已到','2013-11-25 13:28:22','1'),(5,'10.29.03.36.001 ','隧道风机','BAS系统','综合监控系统','10','航中路站','计划预警','小修','1.检查轴承、齿轮传动、齿轮箱油位，添加或更换润滑油。\r\n2.检查、紧固螺拴。\r\n3.消除跑、冒、滴、漏。维修时间已到','2013-02-02 00:00:00','0'),(6,'10.29.03.04.008 ','水泵','BAS系统','综合监控系统','10','航中路站','计划预警','小修','检修填料密封，更换填料。\r\n检查轴承及润滑系统，更换润滑油(脂)。\r\n清理、检修冷却水系统。\r\n清扫、检修阀门。\r\n检查及找正联轴器，调整轴向间隙，更换联轴器易损件。\r\n消除在运行中发现的缺陷和渗漏，及检查和紧固各部螺栓。维修时间已到','2013-02-02 00:00:00','0'),(7,'10.29.08.01.001','P01A道岔转辙机','轨旁设备','信号系统','10','航中路站','计划预警','大修','1．重新放线铺设道岔维修时间已到','2022-02-02 00:00:00','0'),(8,'10.29.08.01.001','P01A道岔转辙机','轨旁设备','信号系统','10','航中路站','计划预警','中修','1．成组更换新道岔（对道岔所有部件进行更换）\r\n2．成组更换新岔枕维修时间已到','2014-02-02 00:00:00','0'),(9,'10.29.13.100.001','第1区间内上行轨道','轨道系统','10号线线路','10','航中路站','计划预警','中修','连续更换25米以上200米以下（含200米）伤损钢轨维修时间已到','2014-02-02 00:00:00','0'),(10,'10.29.03.36.001 ','隧道风机','BAS系统','综合监控系统','10','航中路站','计划预警','中修','包括小修内容。\r\n清洗、检查轴承及轴承箱，更换轴承。\r\n清洗密封装置，更换填料或密封环。\r\n清洗、检查传动齿轮及各零、部件。 \r\n测量、调整各部间隙。\r\n检查、更换联轴器及附件。维修时间已到','2014-02-02 00:00:00','0'),(11,'10.29.03.36.001','隧道风机','BAS系统','综合监控系统','10','航中路站','计划预警','大修','包括中修内容。 \r\n检查或更换主轴、传动轴及前后墙板。 \r\n检查或更换主动、从动转子。 \r\n做转子的静平衡、动平衡。维修时间已到','2014-02-02 00:00:00','0'),(12,'10.29.03.04.008 ','水泵','BAS系统','综合监控系统','10','航中路站','计划预警','中修','1.包括小修内容。\r\n2.检修机械密封，更换零件。\r\n3.解体、清洗检查叶轮、密封环、衬套、轴套、导叶、平衡盘、平衡环及各部零件的磨损、腐蚀、冲蚀程度，予以修复或更换。\r\n4.修理及刮研轴瓦、调整间隙，以及更换轴承。\r\n5.测定叶轮的静平衡。\r\n6.检查各段叶轮毅、轴套、平衡盘毂、紧固螺母间端面接触情况，测量及校正各段叶轮间距。\r\n7.测量泵轴及转子部件各部跳动量。\r\n8.检查、调整各部间隙。调整转子窜动量。\r\n9.校验压力表。\r\n10.检修电机。维修时间已到','2014-02-02 00:00:00','0'),(13,'10.29.03.04.008 ','水泵','BAS系统','综合监控系统','10','航中路站','计划预警','大修','1.包括中修内容。\r\n2.更换叶轮及导叶。\r\n3. 更换泵轴。\r\n4.泵体各段检测、鉴定和作必要的修理。\r\n5.调整泵体的水平度。\r\n6.设备及附属管线除锈防腐。维修时间已到','2017-02-02 00:00:00','1'),(14,'10.29.02.24.001','35kv高压开关','电力SCADA系统','综合监控系统','10','航中路站','计划预警','大修','1.调换和修补裂缝严重的砼杆。  \r\n2.塔基础加固，如增加埋深，杆根培土等。\r\n3.换、调整杆塔的拉线及拉棒等，保证拉线应有的设计强度。包括拉线棒以下的隐蔽部分。  \r\n4.调换腐烂铁横担，扶正倾斜悬瓶、瓷担。调整耐张横担，并除锈、防腐处理，对横担各部螺重新紧固。  \r\n5.调杆、降杆或移杆，扶正倾斜杆塔。\r\n6.锈蚀铁塔的除锈防腐处理。\r\n7.改善防雷设施，重新埋设接地体，或调换严重锈蚀的接地引下线或联接线夹。维修时间已到','2017-02-02 00:00:00','0'),(15,'10.29.16.300.001','桥梁','桥梁系统','10号线线路','10','航中路站','计划预警','大修','每7年对桥梁进行一次结构应力、动力特\r\n性、钢箱梁高强联结螺栓的检查维修时间已到','2019-02-02 00:00:00','0'),(16,'10.29.16.200.001','隧道','桥梁系统','10号线线路','10','航中路站','计划预警','大修','每5年对区间隧道进行1次限界检查。维修时间已到','2017-02-02 00:00:00','0'),(17,'10.29.16.300.001','桥梁','桥梁系统','10号线线路','10','航中路站','计划预警','大修','每7年对桥梁进行一次结构应力、动力特\r\n性、钢箱梁高强联结螺栓的检查维修时间已到','2019-02-02 00:00:00','0');
